const Prices = ({
  bpi: {
    USD: { description, code, rate },
  },
}) => {
  return (
    <div>
      <ul className="list-group">
        <li className="list-group-item">
          Bitcoin rate for {USD.description}:{" "}
          <span class="badge badge-primary">{USD.code}</span>
          <strong>{USD.rate}</strong>
        </li>
      </ul>
    </div>
  );
};

export default Prices;
